Delete an ObjectId from an Array - MongoDB, Mongoose<p>I am trying to delete a 'category' document and it's ObjectId that is in an array inside the 'menu' Schema.
The 'menu' Schema looks like this :</p>
<pre><code>categories: [
  {
    type: ObjectId,
    ref: &quot;Category&quot;,
  },
</code></pre>
<p>it holds the ObjectId i am trying to delete</p>
<p>This is the nodejs code from the controller I try to run :</p>
<pre><code>    const deletedCat = await Category.findByIdAndRemove(catId, function (err) {
  if (err) console.error(err)
})
const updateMenu = await Menu.findOneAndUpdate(
  { _id: menuId },
  { $pull: { categories: { _id: new ObjectId(catId) } } },
  { new: true }
)
</code></pre>
<p>the $pull doesn't change the DB and the ObjectId is still in the Array.</p>
<p>I also tried without the &quot; new ObjectId &quot;</p>
<p>What am I doing wrong ?</p>

