The aggregation pipeline is not enabled for this account<p>I try to execute a mongoDB aggregation pipeline against <a href="https://learn.microsoft.com/en-us/azure/cosmos-db/mongodb-introduction" rel="nofollow noreferrer">Azure Cosmos DB API for MongoDB</a> via a Node.js application. I use the <code>mongodb</code> package with version <code>3.6.2</code> to connect to the cloud ressource.</p>
<p>While the pipeline runs without any error in the Azure Portal, I got an error within the Node environment.</p>
<blockquote>
<p>MongoError: The aggregation pipeline is not enabled for this account. Please see <a href="https://aka.ms/mongodb-aggregation" rel="nofollow noreferrer">https://aka.ms/mongodb-aggregation</a> for details.</p>
</blockquote>
<p>The linked resource seems outdated, because the mentioned Azure Portal entries don't exist anymore.</p>
<p>(My pipeline contains a <code>$group</code> expression. Without the <code>$group</code>, it returns a result.)</p>
<p>I guess, the problem is related to my client setup, since it works within the Mongo Shell.</p>
<pre><code>async function aggregate&lt;T&gt;(pipeline: Record&lt;string, unknown&gt;[]): Promise&lt;T[]&gt; {
  const client = await MongoClient.connect(COSMOSDB_URL), {
    useUnifiedTopology: true,
    auth: { user: COSMOSDB_ACCOUNT_NAME, password: COSMOSDB_PASSWORD }
  });
  try {
    // Returns the error
    return await client.db().collection('coll').aggregate&lt;T&gt;(pipeline).toArray();
  } finally {
    await client.close();
  }
}
</code></pre>
<p>Do you have any suggestions, how to fix the issue?</p>

