<pre><code>{
    merchant: &lt;Reference to the merchant&gt;,
    date: &lt;Date Object&gt;
    name: &quot;Some order name&quot;,
    ingredients: [{
        ingredient: {data: &quot;some data&quot;}
        otherData: &quot;some data&quot;
    }]
}
</code></pre>
<p>I want to query the documents based on the ingredients that they contain.  I have an array of items to search through &quot;objectifiedIngredients&quot;. If it has ingredients in it, then I want to search for orders that contain that ingredient. If the array is empty, then I want to not do the query and just get all orders.  &quot;objectifiedIngredients&quot; is a list of ObjectId's. Here is what I have so far:</p>
<pre><code>      Order.aggregate([
            {$match:{
                merchant: new ObjectId(req.session.user),
                date: {
                    $gte: from,
                    $lt: to
