                ingredients: {
                    $elemMatch: {
                        ingredient: {
                            $in: objectifiedIngredients
                        }
                    }
                }
            }}
        ])
</code></pre>
<p>How can I run the <code>$match</code> on ingredients only if the array has elements in it? I have tried using <code>$cond</code>, but either it doesn't work here or I didn't use it right.</p>

